import{_ as t,c as e,o as r,ae as i}from"./chunks/framework.D7Xxp1-g.js";const o="/searobot-docs/images/rtk-navigation/image6.png",n="/searobot-docs/images/rtk-navigation/image7.png",g=JSON.parse('{"title":"导航功能","description":"","frontmatter":{},"headers":[],"relativePath":"rtk-navigation/navigation.md","filePath":"rtk-navigation/navigation.md"}'),s={name:"rtk-navigation/navigation.md"};function l(p,a,h,c,d,m){return r(),e("div",null,a[0]||(a[0]=[i('<h1 id="导航功能" tabindex="-1">导航功能 <a class="header-anchor" href="#导航功能" aria-label="Permalink to &quot;导航功能&quot;">​</a></h1><p>在确保RTK定位状态、底盘状态、传感器状态的前提下，才能正常使用RTK导航。</p><h2 id="参数设置" tabindex="-1">参数设置 <a class="header-anchor" href="#参数设置" aria-label="Permalink to &quot;参数设置&quot;">​</a></h2><h3 id="设置运行速度和目标终点" tabindex="-1">设置运行速度和目标终点 <a class="header-anchor" href="#设置运行速度和目标终点" aria-label="Permalink to &quot;设置运行速度和目标终点&quot;">​</a></h3><p>导航车的运行速度单位为m/s，限速为0.8，一般推荐设置为0.5。根据地图显示的点序号，设置希望前往的目标点序号。</p><h2 id="导航操作" tabindex="-1">导航操作 <a class="header-anchor" href="#导航操作" aria-label="Permalink to &quot;导航操作&quot;">​</a></h2><h3 id="启动与终止rtk导航任务" tabindex="-1">启动与终止RTK导航任务 <a class="header-anchor" href="#启动与终止rtk导航任务" aria-label="Permalink to &quot;启动与终止RTK导航任务&quot;">​</a></h3><p>遥控将车子的方向调整为将要前进的方向，将遥控器模式切换为导航上位机模式（参考遥控说明手册），点击【启动】开启任务，开启任务后点位和当前小车位置会显示在地图区域，并显示行驶路径，中途如果需要停车则点击【终止】停止该任务。当到达目标点位置后会显示导航成功。</p><p>在导航的过程，如果雷达的前方或侧方出现人员经过或障碍物时，车辆会避障停车。当障碍物远离时，则恢复无障碍状态，继续导航任务。（避障距离前方约2米，侧方40厘米）</p><p><img src="'+o+'" alt=""></p><p><em>RTK导航成功状态</em></p><h2 id="rtk位置归零" tabindex="-1">RTK位置归零 <a class="header-anchor" href="#rtk位置归零" aria-label="Permalink to &quot;RTK位置归零&quot;">​</a></h2><p>当导航车与上一次RTK定位时的半径距离超过5公里时，需要对RTK定位的位置进行重新定位。点击【RTK位置归零】，若确认重新RTK位置归零后，对应的之前设置保存后的轨迹也会清空。需要手动到车子后台重新关闭mqtt服务并重新打开即可生效。</p><p><img src="'+n+'" alt=""></p><p><em>RTK位置归零状态</em></p>',15)]))}const T=t(s,[["render",l]]);export{g as __pageData,T as default};
